import { React, useState } from "react"
import './Chat.css'
import bookielogo from '../assets/bookieonlylogo.png'
import { Link } from 'react-router-dom';
import { ChatsGenerate } from "../assets/scripts/chatsgenerate";

function Chat() {
    var uzenet = []
    var User = []
    var chat = []
    function messagesgen() {
        const idk2 = []
        for (var i = 0; i < 52; i++) {
            if (i % 2 == 0) {
                idk2.push({
                    Who: "me",
                    Username: "Username",
                    Time: "Time",
                    Message: "Message",
                })
            }
            else {
                idk2.push({
                    Who: "you",
                    Username: "Username",
                    Time: "Time",
                    Message: "Message",
                })
            }
        }

        idk2.forEach((idkk) => {
            uzenet.push(
                <li class={idkk.Who}>
                    <div class="entete">

                        <h3>{idkk.Time}</h3>
                    </div>
                    <div class="message">
                        {idkk.Message}
                    </div>
                </li>)
        })
    }
    function chatsgen() {
        ChatsGenerate()
    }
    function usergen() {
        const idk2 = []
        idk2.push({
            Kep: bookielogo,
            Username: "Username",
        })

        idk2.forEach((idkk) => {
            User.push(
                <header id="userbg">
                    <img src={idkk.Kep} alt="" />
                    <h2>{idkk.Username}</h2>
                </header>)
        })
    }
    messagesgen()
    
    usergen()
    return (
        <div id="container">
            <aside>
                <header>
                    <input type="text" placeholder="Keresés" />
                </header>
                <ul>
                    {chatsgen()}
                </ul>
            </aside>
            <div className="main">
                {User}
                <ul id="chat">
                    {uzenet}
                </ul>
                <footer>
                    <img src="https://s3-us-west-2.amazonaws.com/s.cdpn.io/1940306/ico_picture.png" alt="" />
                    <textarea placeholder="Írd be az üzeneted"></textarea>
                    <a href="#">Küldés</a>
                </footer>
            </div>
        </div>
    )
}

export default Chat
